import React, { useState, useEffect, useRef } from "react";
import styled from "styled-components";
import { Link } from "react-router-dom";
import palette from "../../lib/styles/palette";
import Button from "../../components/common/Button";
import Calendar from "react-calendar";
import moment from "moment";
import "react-calendar/dist/Calendar.css";
import posed from "react-pose";
import Modal from "./modal";
/**
 * 회원가입 또는 로그인 폼을 보여줍니다.
 */

const AuthFormBlock = styled.div`
  h3 {
    vertical-align: top;
    margin: 0;
    color: ${palette.gray[8]};
    margin-bottom: 1rem;
  }
`;

/**
 * 스타일링된 input
 */
const StyledInput = styled.input`
  font-size: 1rem;
  display: table-cell;
  border: none;
  color: black;
  width: 360px;
  border: 1px solid ${palette.gray[5]};
  padding: 0.5rem;
  outline: none;
  margin-bottom: 3rem;
  &:focus {
    color: $oc-teal-7;
  }
`;

/**
 * 폼 하단에 로그인 혹은 회원가입 링크를 보여줌
 */
const Footer = styled.div`
  margin-top: 2rem;
  text-align: right;
  a {
    color: ${palette.gray[6]};
    text-decoration: underline;
    &:hover {
      color: ${palette.gray[9]};
    }
  }
`;

const ButtonWithMarginTop = styled(Button)`
  margin-top: 1rem;
  position: absoulte;
  width: auto;
  height: 50px;
  margin: 1rem;
`;

const textMap = {
  login: "로그인",
  register: "기본정보"
};

/**
 * 에러를 보여줍니다
 */
const ErrorMessage = styled.div`
  color: red;
  text-align: center;
  font-size: 0.875rem;
  margin-top: 1rem;
`;
const ThirdRegisterPage = ({ type, form, onChange, onSubmit, error }) => {
  const hi = textMap[type];
  const [isCalendarOpen, setIsCalendarOpen] = useState(false);
  const [date, setDate] = useState("");
  const onDateChange = date => {
    console.log(date);
    setDate(moment(date).format("YYYY-MM-DD"));
  };
  const openCalendar = () => {
    setIsCalendarOpen(!isCalendarOpen);
  };

  return (
    <AuthFormBlock>
      <h3>{hi}</h3>
      <div style={{ float: "right" }}>
        <ButtonWithMarginTop
          onClick={e => onSubmit(e, e.target.id)}
          type="submit"
          id="temporarySave"
          form="myform"
          cyan
          fullWidth
          style={{ marginTop: "1rem" }}
        >
          {"임시저장"}
        </ButtonWithMarginTop>
      </div>
      <form onSubmit={onSubmit} id="myform">
        <strong>주력제조상품</strong>
        <StyledInput
          autoComplete="username"
          name="username"
          onChange={onChange}
          value={form.username}
        />
        <StyledInput
          autoComplete="new-password"
          name="password"
          placeholder="주요사업"
          onChange={onChange}
          value={form.password}
        />
        <StyledInput
          autoComplete="new-password"
          name="passwordConfirm"
          placeholder="생산국가"
          type="password"
          onChange={onChange}
          value={form.passwordConfirm}
        />
        <strong>운영시작년도</strong>
        <StyledInput
          autoComplete="businessLicenseNumber"
          name="businessLicenseNumber"
          onChange={onChange}
          onClick={openCalendar}
          value={date}
          placeholder="눌러서 선택해주세요"
        />
        <Modal
          isOpen={isCalendarOpen}
          toggle={openCalendar}
          initialPose="closed"
          pose={isCalendarOpen ? "open" : "closed"}
        >
          <Calendar onChange={onDateChange} />
        </Modal>
        <StyledInput
          autoComplete="businessOperatorName"
          name="businessOperatorName"
          placeholder="담당자"
          onChange={onChange}
          value={form.businessOperatorName}
        />
        <StyledInput
          autoComplete="businessOperatorName"
          name="businessOperatorName"
          placeholder="대표번호"
          onChange={onChange}
          value={form.businessOperatorName}
        />
        <StyledInput
          autoComplete="businessOperatorName"
          name="businessOperatorName"
          placeholder="대표번호"
          onChange={onChange}
          value={form.businessOperatorName}
        />
        {error && <ErrorMessage>{error}</ErrorMessage>}
        <div style={{ float: "right" }}>
          <ButtonWithMarginTop
            onClick={e => onSubmit(e, "currentThirdMovePrev")}
            cyan
            fullWidth
            style={{ marginTop: "1rem" }}
          >
            {"이전"}
          </ButtonWithMarginTop>
          <ButtonWithMarginTop cyan fullWidth style={{ marginTop: "1rem" }}>
            {"가입하기"}
          </ButtonWithMarginTop>
        </div>
      </form>
      <Footer></Footer>
    </AuthFormBlock>
  );
};

export default ThirdRegisterPage;
